import React, { Component } from 'react';



class AddTodo extends Component {
   
  render(){
    return (
        <div>
            <form>
                <input
                 type="text"
                 placeholder = "add todo ..."
                 name = "title" 
                 className="inputtitle"
                ></input>
                <input 
                type="submit"
                name = "submit"
                value="submit"
                className="inputsubmit"

                 ></input>
            </form>
        </div>
    )
  }
}

export default AddTodo;
